import{_ as t}from"./plugin-vue_export-helper-c27b6911.js";import{o as e,c as r,f as n}from"./app-56f07e55.js";const l={},d=n('<h3 id="汇编格式" tabindex="-1"><a class="header-anchor" href="#汇编格式" aria-hidden="true">#</a> 汇编格式</h3><p>linux下汇编为AT&amp;T格式，而在windows中则为intel格式，二者区别如下：</p><table><thead><tr><th style="text-align:center;"><strong>规则</strong></th><th style="text-align:center;"><strong>Intel风格</strong></th><th style="text-align:center;"><strong>AT&amp;T风格</strong></th></tr></thead><tbody><tr><td style="text-align:center;">操作数顺序</td><td style="text-align:center;">目的操作数，源操作数</td><td style="text-align:center;">源操作数，目的操作数</td></tr><tr><td style="text-align:center;">寄存器</td><td style="text-align:center;">rax</td><td style="text-align:center;">%rax</td></tr><tr><td style="text-align:center;">立即数</td><td style="text-align:center;">1</td><td style="text-align:center;">$1</td></tr><tr><td style="text-align:center;">16进制</td><td style="text-align:center;">后缀加H</td><td style="text-align:center;">前缀加0x</td></tr><tr><td style="text-align:center;">访问内存长度</td><td style="text-align:center;">前缀BYTE PTR等</td><td style="text-align:center;">后缀b,w,q,l等</td></tr><tr><td style="text-align:center;">绝对寻址</td><td style="text-align:center;">[imm]</td><td style="text-align:center;">imm</td></tr><tr><td style="text-align:center;">间接寻址</td><td style="text-align:center;">[rap]</td><td style="text-align:center;">(%rap)</td></tr><tr><td style="text-align:center;">基址相对寻址</td><td style="text-align:center;">[rap+imm]</td><td style="text-align:center;">imm(%rap)</td></tr><tr><td style="text-align:center;">变址寻址</td><td style="text-align:center;">[rbp+rdi]</td><td style="text-align:center;">(%rbp+%rdi)</td></tr><tr><td style="text-align:center;">相对变址寻址</td><td style="text-align:center;">[rbp+rdi+imm]</td><td style="text-align:center;">imm(%rbp+%rdi)</td></tr></tbody></table>',3),a=[d];function i(s,c){return e(),r("div",null,a)}const y=t(l,[["render",i],["__file","汇编.html.vue"]]);export{y as default};
